import React from 'react';

const Footer = () => {
  return (
    <footer className="footer">
      <img src="/img/DH.PNG" alt="Logo" className="footer-logo" />
      <img src="/img/ico-facebook.png" alt="Logo" className="" />
    
      <p>Derechos reservados &copy; 2023</p>
    </footer>
  );
};

export default Footer;
